import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ResourceTable = () => {
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Extract instance ID from the URL path (if provided)
  const instanceId = window.location.pathname.split('/')[2]; // Adjusted for React routing, assuming the URL format is /resources/:id

  useEffect(() => {
    const apiUrl = "http://localhost:8080/api/resources";

    // if (instanceId) {
    //   // If instance ID is provided, fetch that specific resource
    //   apiUrl = process.env.REACT_APP_BACKEND_URL + `/api/resources/${instanceId}`;
    // } else {
    //   // If no instance ID is provided, fetch all resources
    //   apiUrl = process.env.REACT_APP_BACKEND_URL + '/api/resources';
    // }

    // Fetch data from the backend
    axios.get(apiUrl)
      .then(response => {
        setResources(response.data);
        setLoading(false);
      })
      .catch(error => {
        setError('Failed to fetch resources');
        setLoading(false);
      });
  }, [instanceId]); // Dependency on instanceId so it triggers when the URL changes

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  // Render a single resource if the response is a single object, otherwise render an array of resources
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Region</th>
          <th>Type</th> 
          <th>Status</th>
          <th>IP</th>
          <th>Created Time</th>
        </tr>
      </thead>
      <tbody>
        {Array.isArray(resources) ? (
          resources.map(resource => (
            <tr key={resource.name}>
              <td>{resource.name}</td>
              <td>{resource.zone}</td>
              <td>{resource.type}</td> 
              <td>{resource.status || 'N/A'}</td>
              <td>{resource.ipAddresses && resource.ipAddresses.length > 0 ? resource.ipAddresses.join(', ') : 'N/A'}</td>
              <td>{resource.creationTimestamp || 'N/A'}</td>
            </tr>
          ))
        ) : (
          // If it's a single resource, display it directly
          <tr>
            <td>{resources.name}</td>
            <td>{resources.zone}</td>
            <td>{resources.type}</td>
            <td>{resources.status || 'N/A'}</td>
            <td>{resources.ipAddresses && resources.ipAddresses.length > 0 ? resources.ipAddresses.join(', ') : 'N/A'}</td>
            <td>{resources.creationTimestamp || 'N/A'}</td>
          </tr>
        )}
      </tbody>
    </table>
  );
};

export default ResourceTable;
